    postsData: {
        text: string
    }[]
}

const ProfilePage: FC<ProfilePageProps> = (props) => {
    const {postsData} = props

  return (
    <>
      <ProfileInfo />
      <h2>My Posts</h2>
      <NewPostTextArea />
      <NewPostButton />
      {postsData.map((post) => {
        console.log(post);
        return <Post postText={post.text} />;
      })}
    </>
  );
};

export default ProfilePage;
